import classes from "./button.module.css";

function Button({ children, styleClass, textOnly, ...props }) {
  let btnClasses = `${styleClass} ${classes.button_rounded} ${
    textOnly ? "button-text" : "button-color"
  }`;
  console.log(typeof btnClasses);

  return (
    <button className={btnClasses} {...props}>
      {children}
    </button>
  );
}

export default Button;
